// components/MatrixTable/MatrixHeader.tsx
import React from 'react';
import { TableHead, TableRow, TableCell, IconButton } from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';

interface MatrixHeaderProps {
  numCols: number;
  onRemoveColumn: (colIndex: number) => void;
}

const MatrixHeader: React.FC<MatrixHeaderProps> = ({ numCols, onRemoveColumn }) => (
  <TableHead>
    <TableRow>
      {Array.from({ length: numCols }, (_, colIndex) => (
        <TableCell key={colIndex}>
          Cell Value N = {colIndex + 1}
          <IconButton
            onClick={() => onRemoveColumn(colIndex)}
            color="secondary"
            style={{ marginLeft: 8 }}
          >
            <DeleteIcon />
          </IconButton>
        </TableCell>
      ))}
      <TableCell>Row Sum</TableCell>
      <TableCell>Actions</TableCell>
    </TableRow>
  </TableHead>
);

export default MatrixHeader;
